import { Navigate } from 'react-router';
import Search from '../Pages/Search/Search';

const routes = [
  {path: '/', element: <Navigate to='/search'/>},
  {path: '/search', element: <Search/>},
  {path: '/search', element: <Search/>}
]

export default routes
